import React from 'react';
import './Home.css';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const navigate = useNavigate();

  const quickLinks = [
    { title: 'Patient Records', route: '/patient-records' },
    { title: 'Appointments', route: '/appointments' },
    { title: 'AI Dental Assistant', route: '/ai-assistant' },
    { title: 'Finance & Billing', route: '/finance' },
    { title: 'Inventory Management', route: '/inventory' },
    { title: 'Lab Work Tracking', route: '/lab-tracking' },
    { title: 'Illustrations', route: '/Illustrations' },
    { title: 'Dental Diary', route: '/notes' }

  ];

  return (
    <div className="home-container">
      <div className="clinic-header">
        <h1>Elite Dental Clinic</h1>
        
        <p>Your Complete Dental Practice Manager</p>
      </div>

      <div className="quick-links">
        {quickLinks.map((link, idx) => (
          <div key={idx} className="card" onClick={() => navigate(link.route)}>
            <h3>{link.title}</h3>
            <button>Go</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
